def complement(text):
    """complement of text"""
    compl=""
    nt = len(text)
    for i in range (0,nt):
        if text[i]=="G":
            compl=compl+"C"
        if text[i]=="C":
            compl=compl+"G"
        if text[i]=="A":
            compl=compl+"T"
        if text[i]=="T":
            compl=compl+"A"
    return compl

def reverse(text):
    """reverse of text"""
    return text[::-1]

def Lwindows(text,L):
    """list of all L-windows in text"""
    windows=list()
    for i in range (0,len(text)-L+1):
        windows.append(kmer(text,i,L))
    return windows

def kmer(text, i, k):
    """substring of text from i-th position for the next k letters"""
    return text[i:(i+k)]

def Shared(k, string1, string2):
    locations = {}
    wind1=Lwindows(string1, k)
    for i in range (len(wind1)):
        rev = reverse(complement(wind1[i]))
        if wind1[i] in locations:
            locations[wind1[i]].append(i)
        else:
            locations[wind1[i]] = [i]
        if rev in locations:
            locations[rev].append(i)
        else:
            locations[rev] = [i]
    l = []
    wind2=Lwindows(string2, k)
    for i in range (len(wind2)):
        if wind2[i] in locations:
            for loc in locations[wind2[i]]:
                l.append([loc, i])
    return l


x = '''12

'''
inlines = x.split("\n")
k = int(inlines[0])
string1 = inlines[1]
string2 = inlines[2]
res = Shared(k, string1, string2)
for r in res:
    for i in range (len(r)):
        r[i]=str(r[i])
    print("("+", ".join(r)+")")
